notes:
Segue anexo a pré-especificação com dúvidas em amarelo.

*Requisitos*
•	Inclusão de um botão “Plano de Melhoria” no Grid da tela Principal da funcionalidade ‘Apuração do Indicador do Programa’
       o O Botão só ficará habilitado ao selecionar uma linha do Grid
       o O Plano de Melhoria da apuração do indicador do programa é por exercício e pode ser informado independente do indicador ter apuração informada;

•	 Ao clicar o botão “Plano de Melhoria”: 
       o Plano de Melhoria: campo obrigatório, Alfanumérico, 5000 caracteres (CLOB);
          - O usuário informa o plano de melhoria; 
          - Ao “ Salvar” pela primeira vez o “Plano de Melhoria” será gravado o usuário de inclusão, as demais vezes o usuário de alteração;
          - Ficará gravado somente o último usuário de alteração;

• *Dúvida:* Qualquer usuário tem acesso a “Apuração do indicador do programa” pode manter o Plano de Melhoria?
• *Dúvida:* Deve ser exibido o plano de melhoria feito no exercício anterior, como base para o plano de melhoria do exercício atual? 



Para tanto foram calculados:
Ponto de Função(PF) Total: 6
Esforço em dias úteis:  8
Favor aprovar a demanda ou reportar necessidades de ajuste.

Requisitos

*• Plano de Melhoria – Incluir/Alterar*
o Inclusão do botão “Plano de Melhoria” no Grid da tela Principal da funcionalidade ‘Apuração do Indicador do Programa’;
o O Botão só fica habilitado ao selecionar uma linha do Grid;
o O Plano de Melhoria da apuração do indicador do programa é por exercício e pode ser informado independente do indicador ter apuração informada;
*• Ao clicar no botão “Plano de Melhoria”:*
o Plano de Melhoria: campo obrigatório, CLOB.
- Qualquer usuário que tem acesso a “Apuração do indicador do programa” pode Incluir/Alterar o Plano de Melhoria;
- Será exibido, se existir, o plano de melhoria feito em exercício anterior, como base para o plano de melhoria do exercício atual;
- Ao “ Salvar” pela primeira vez o “Plano de Melhoria” será gravado o usuário de inclusão, as demais vezes o usuário de alteração;
- Ficará gravado somente o último usuário de alteração.

*• Exportar – Plano de Melhoria*
o Inclusão do “Plano de Melhoria” no Grid da tela Principal da funcionalidade ‘Apuração do Indicador do Programa’
Novos campos a serem incluídos no Grid:
- Plano de Melhoria;
- Usuário Inclusão Plano de Melhoria;
- Data Inclusão Plano de Melhoria;
- Usuário Última Alteração Plano de Melhoria;
- Data Última Alteração Plano de Melhoria.
o Ao clicar no Botão “Exportar”, será exportado, juntamente com as informações já existentes, o “Plano de Melhoria”

*• Obs.: Nenhuma crítica será feita referente a data de corte, usuário ou a inclusão/alteração do Plano de melhoria.*

*Para tanto foram calculados:*
Ponto de Função(PF) Total: 20
Esforço em dias úteis : 9
Qtd de DEVs envolvidos: 3

Favor aprovar a demanda ou reportar necessidades de ajuste.

